message:
@Sylvia Kotting-Uhl hat als erste deutsche Politikerin das havarierte Atomkraftwerk in Japan besucht und berichtet in einem kurzen Video über ihre Erlebnisse in Fukushima und das Voranschreiten der Arbeiten vor Ort.
Ausführlicher schildert sie ihre Eindrücke und Gespräche in einem Reisetagebuch:
www.gruene-bundestag.de/themen/atomausstieg/reisetagebuch_ID_4390319/6122013-mit-chaos-zum-chaos_ID_4390320.html
